import React from "react";
import './BodyStart.css';


class BodyStart extends React.Component {
    render() {
        return (
            <div>
            <div className="bg-image-body-conteiner">
                <img src={this.props.background} className="bg-image" alt="Background"></img>
                <div className="profile-container">
                   <img src={this.props.myPhoto} className="myPhoto"/>
                   <h2 className="profile-name">{this.props.name}
                   </h2>
                </div>
                </div>
            </div>
        )


    }

}
 export default BodyStart;
